sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

outputs.clean_output = inputs.dirty_input
    .replace(/\\n/g, '')
    .replace(/\\t/g, '')
    .replace(/\\n/g, '')
    .replace(/```json/g, '')
    .replace(/```/g, '')
    .replace(/\\"/g, '"'); // Replace escaped double quotes with double quotes

outputs.clean_output = outputs.clean_output
    .replace(/{"model_output":"/g, '{"model_output":')
    .replace(/"string"}]}"}/, '"string"}]}}'); // Removed extra quotes and corrected regex

})(inputs, outputs);

